import '../css/styles.css';


class Header extends Component {
    inputChangeHandler(event) {
        console.log('I was changed');
    }
    render() {
        return (
            <header>
                <div className="logo">Logo</div>
                <input type="text" onChange={this.inputChangeHandler}/>
            </header>
        )
    }
}

export default Header;
